import logo1 from "./images/logo 1_svg.svg";
function Logo() {
    const logoStyle = {
        width: "100%",
        height: "auto",

      };
    return(
        <img
        src = {logo1}
        alt=""
        style={logoStyle}
      />
    )
}
export default Logo;
